        public LaavorControl(string hash)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Invalid Hash");
            }
        }

        /// <summary>
        /// Internal 
        /// </summary>
        /// <param name="design"></param>
        /// <param name="color"></param>
        /// <param name="side"></param>
        /// <param name="hash"></param>
        /// <returns></returns>
        public string GetItemArrow(DesignType design, ColorUI color, Side side, string hash)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Invalid Hash");
            }
            else
            {
                MethodInfo methodToInvoke = GetType().GetMethod("GetImage" + design.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

                object[] parametersInvoke = { color, side };

                var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
                return returnStringColor;
            }
        }
